import React, { Component } from 'react'

export default class Admin extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email:'',
            password:'',
            role : ''
        };
    }

    componentDidMount() {
        // send HTTP request
        // save it to the state
    }
    create(e) {
        // add entity - POST
        e.preventDefault();
    }
    update(e) {
        // update entity - PUT
        e.preventDefault();
    }
    delete(e) {
        // delete entity - DELETE
        e.preventDefault();
    }
    handleChange(changeObject) {
        this.setState(changeObject)
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown">
                    <div id="formContent">
                        {/* Tabs Titles */}
                        {/* Icon */}
                        <div className="fadeIn first">
                            <h1>Sign In</h1>
                            {/* <img src="../img/lock.jpg" id="icon" alt="User Icon" /> */}
                        </div>
                        {/* Login Form */}
                        <form>
                            <input type="email" value={this.state.name} onChange={(e) => this.handleChange({ name: e.target.value })}required id="login" className="fadeIn email second" name="email" placeholder="login" />
                            <input type="password" id="password" className="fadeIn password third" name="password" placeholder="password" />
                            <input type="submit" className="fadeIn fourth" defaultValue="Log In" />
                        </form>
                        {/* Remind Passowrd */}
                        <div id="formFooter">
                            <a className="underlineHover" href="#">Forgot Password?</a>
                        </div>
                    </div>
                </div>
            </div>

        )
    }
}
